CKEDITOR.plugins.setLang("a11yhelp","ro",{title:"Instruc\u021biuni Accesibilitate",contents:"Cuprins. Pentru a \xeenchide acest dialog, ap\u0103sa\u021bi tasta ESC.",legend:[{name:"General",items:[{name:"Editor bar\u0103 de instrumente.",legend:"Apas\u0103 ${toolbarFocus} pentru a naviga pe de instrumente. Pentru deplasarea la urm\u0103torul sau anteriorul grup de instrumente se folosesc tastele TAB \u0219i SHIFT+TAB. Pentru deplasare pe urmatorul sau anteriorul instrument se folosesc tastele S\u0102GEAT\u0102 DREAPTA sau S\u0102GEAT\u0102 ST\xc2NGA. Tasta SPA\u021aIU sau ENTER activeaz\u0103 instrumentul."},{name:"Dialog editor",legend:"\xcen interiorul unui dialog, se apas\u0103 TAB pentru navigarea la urm\u0103torul element de dialog, SHIFT+TAB pentru deplasarea la anteriorul element de dialog, ENTER pentru validare dialog, ESC pentru anulare dialog. C\xe2nd un dialog are sec\u021biuni multiple, lista sec\u021biunilor este accesibil\u0103 cu ALT+F10 sau cu TAB ca parte a ordon\u0103rii sec\u021bion\u0103rii dialogului. Cu lista sec\u021biunii activat\u0103, deplasarea \xeenainte \xeenapoi se face cu tastele S\u0102GEAT\u0102 DREAPTA \u0219i respectiv ST\xc2NGA."},{name:"Editor meniu contextual",legend:"Apas\u0103 ${contextMenu} sau TASTA MENIU pentru a deschide meniul contextual. Se trece la urm\u0103toarea op\u021biune din meniu cu TAB sau S\u0102GEAT\u0102 JOS. La op\u021biunea anterioar\u0103 cu SHIFT+TAB sau S\u0102GEAT\u0102 SUS. Se apas\u0103 SPA\u021aIU sau ENTER pentru a selecta op\u021biunea. Deschide sub-meniul op\u021biunii curente cu SPA\u021aIU sau ENTER sau S\u0102GEAT\u0102 DREAPTA. Se revine la elementul din meniul p\u0103rinte cu ESC sau S\u0102GEAT\u0102 ST\xc2NGA. \xcenchide meniul de context cu ESC."},{name:"Caseta list\u0103 a editorului",legend:"\xcen interiorul unei liste, treci la urm\u0103torull element cu TAB sau S\u0102GEAT\u0102 JOS. Treci la elementul anterior din list\u0103 cu SHIFT+TAB sau S\u0102GEAT\u0102 SUS. Apas\u0103 SPA\u021aIU sau ENTER pentru a selecta op\u021biunea din list\u0103. Apas\u0103 ESC pentru a \xeenchide lista."},{name:"Bara c\u0103ii editorului de elemente",legend:"Apas\u0103 ${elementsPathFocus} pentru navigare pe elementele barei. Mergi la urm\u0103torul buton cu TAB sau S\u0102GEAT\u0102 JOS. Treci la butonul anterior din list\u0103 cu SHIFT+TAB sau S\u0102GEAT\u0102 SUS. Apas\u0103 SPA\u021aIU sau ENTER pentru a selecta butonul \xeen editor."}]},{name:"Comenzi",items:[{name:"Revino anterior (Undo)",legend:"Apas\u0103 ${undo}"},{name:"Comanda precedent\u0103",legend:"Apas\u0103 ${redo}"},{name:"\xcengro\u0219at (Bold)",legend:"Apas\u0103 ${bold}"},{name:"\xcenclinat (Italic)",legend:"Apas\u0103 ${italic}"},{name:"Subliniere (Underline)",legend:"Apas\u0103 ${underline}"},{name:"Legatur\u0103 (Link)",legend:"Apas\u0103 ${link}"},{name:"Desf\u0103\u0219urare Bar\u0103 instrumente",legend:"Apas\u0103 ${toolbarCollapse}"},{name:"Accesare spa\u021biu focus anterior",legend:"Apas\u0103 ${accessPreviousSpace} pentru a accesa cel mai apropiat spa\u021biu focus indisponibil \xeenaintea cursorului, de exemplu: 2 elemente adiacente HR. Repet\u0103 combina\u021bia de taste pentru a accesa spa\u021biile \xeendep\u0103rtate de focus."},{name:"Accesare spa\u021biu focus urm\u0103tor",legend:"Apas\u0103 ${accessNextSpace} pentru a accesa cel mai apropiat spa\u021biu focus indisponibil dup\u0103 cursor, de exemplu: 2 elemente adiacente HR. Repet\u0103 combina\u021bia de taste pentru a accesa spa\u021biile \xeendep\u0103rtate de focus."},{name:"Ajutor Accesibilitate",legend:"Apas\u0103 ${a11yHelp}"},{name:"Adaug\u0103 ca Text simplu (Plain Text)",legend:"Apas\u0103 ${pastetext}",legendEdge:"Apas\u0103 ${pastetext}, urmat de ${paste}"}]}],tab:"TAB",pause:"Pauz\u0103",capslock:"Majuscule",escape:"Esc - renun\u021b\u0103",pageUp:"Pagin\u0103 sus",pageDown:"S\u0103geat\u0103 jos",leftArrow:"S\u0103geat\u0103 st\xe2nga",upArrow:"S\u0103geat\u0103 sus",rightArrow:"S\u0103geat\u0103 dreapta",downArrow:"S\u0103geat\u0103 jos",insert:"Insereaz\u0103",leftWindowKey:"Windows st\xe2nga",rightWindowKey:"Windows dreapta",selectKey:"Tasta Selec\u021bie",numpad0:"0 Numeric",numpad1:"1 Numeric",numpad2:"2 Numeric",numpad3:"3 Numeric",numpad4:"4 Numeric",numpad5:"5 Numeric",numpad6:"6 Numeric",numpad7:"7 Numeric",numpad8:"8 Numeric",numpad9:"9 Numeric",multiply:"\xcenmul\u021bire",add:"Adunare",subtract:"Sc\u0103dere",decimalPoint:"Punct zecimal",divide:"\xcemp\u0103r\u021bire",f1:"F1",f2:"F2",f3:"F3",f4:"F4",f5:"F5",f6:"F6",f7:"F7",f8:"F8",f9:"F9",f10:"F10",f11:"F11",f12:"F12",numLock:"NumLock",scrollLock:"Scroll Lock",semiColon:"Punct \u0219i virgul\u0103",equalSign:"Egal",comma:"Virgul\u0103",dash:"Linie",period:"Punct",forwardSlash:"Slash",graveAccent:"Accent grav",openBracket:"Parantez\u0103 dreapt\u0103 st\xe2nga",backSlash:"Backslash",closeBracket:"Parantez\u0103 dreapt\u0103 dreapta",singleQuote:"Ghilimea simpl\u0103"});